// Contact.jsx
import React from 'react';
import { motion } from 'framer-motion';

const Contact = () => {
  return (
    <motion.section
      id="contact"
      className="text-white px-8 py-16"
      initial={{ opacity: 0, y: 50 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      viewport={{ once: true }}
    >
      <h2 className="text-3xl font-bold text-primary mb-4">Contact</h2>
      <p className="text-gray-300">Email: roshithakommana18@gmail.com</p>
      <p className="text-gray-300">Phone: 6302680957</p>
    </motion.section>
  );
};

export default Contact;
